class Solution(object):
    def candy(self, ratings):
        """
        :type ratings: List[int]
        :rtype: int
        """
        if not ratings:
            return 
        res = [1]*len(ratings)
        for i in xrange(1,len(ratings)):
            if ratings[i] > ratings[i-1]:
                res[i] = res[i-1]+1

        
        base = res[-1]
        for i in xrange(len(ratings)-2,-1,-1):
            if ratings[i] > ratings[i+1]:
                base += 1 
            else:
                base = 1
            res[i] = max(res[i],base)
        return sum(res)
            
        